import React, { Fragment } from 'react';
import './App.css';
import Home from './Components/Home/Home';
import Studies from './Components/Studies/Studies';
import Experience from './Components/Experience/Experience';
import Projects from './Components/Projects/Projects';
import Contact from './Components/Contact/Contact';
import Login from './Components/Login/Login';
// ========== MUI Components =========
// import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import LoginIcon from '@mui/icons-material/Login';
import WorkIcon from '@mui/icons-material/Work';
// ============= ROUTES ================
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
//=====================================
function App() {
  return (
    <Router>
      <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static">
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            <WorkIcon sx={{ fontSize: 15 }}/>BreafCase
          </Typography>
          <Button color="inherit" onClick={()=><Home/>}>Home</Button>
          <Button color="inherit">Studies</Button>
          <Button color="inherit">Experiences</Button>
          <Button color="inherit">Projects</Button>
          <Button color="inherit">Contact</Button>
          <Button color="inherit"><LoginIcon />Login</Button>
        </Toolbar>
      </AppBar>
    </Box>
    <hr />
    <Switch>
      <Route exact path="Components/Home/Home.jsx"><Home/></Route>
    </Switch>
    </Router>
  );
}

export default App;
